// https://opentdb.com/api.php?amount=6&category=18&difficulty=easy
export default function Quiz(props) {
    // const [questions, setQuestions] = React.useState([])
    let questions = []

    fetch("https://opentdb.com/api.php?amount=3&category=10&difficulty=medium&type=multiple")
        .then(res => res.json())
        .then(data => data.results.map(ques => {
            // console.log(ques)
            questions.push(1)
        }))

    console.log(questions)

